import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class ShopOwnerService {
  API = "http://localhost:8066/api/Owners"; // Updated base URL

  constructor(private http: HttpClient) {}

  // Register a new ShopOwner
  public registerShopOwner(ShopOwnerData: any) {
    return this.http.post(`${this.API}`, ShopOwnerData); // Matches POST /api/Owners
  }

  // Get all shop owners
  public getShopOwner() {
    return this.http.get(`${this.API}`); // Matches GET /api/Owners
  }

  // Delete a shop owner by ID
  public deleteShopOwner(id: number) {
    return this.http.delete(`${this.API}/${id}`); // Matches DELETE /api/Owners/{id}
  }

  // Update a shop owner
  public updateShopOwner(shopowner: any) {
    return this.http.put(`${this.API}/${shopowner.id}`, shopowner); // Matches PUT /api/Owners/{id}
  }
}
